const styles = {
    container: {
        backgroundColor: '#F0F0F5',
        alignItems: 'center',
        flex: 1,
        justifyContent: 'center',
    },


    editor: {
        marginLeft: 350
    },

    image: {
        aspectRatio: 1,
        width: '50%',
        marginTop: 20,
    },


    input: {
        backgroundColor: "white",
        borderRadius: 25,
        padding: 8,
        marginTop: 0,
        marginBottom: 20,
    },
    
    inputDesc: {
        backgroundColor: '#fff',
        borderRadius: 25,
        height: 120,
        paddingHorizontal: 10,
        paddingVertical: 10,
        marginTop: 0,
        marginBottom: 70,
    },


    text: {
        marginLeft: 14,
        fontSize: 20
    },

    title: {
        color: '#322153',
        fontSize: 20,
        fontFamily: 'Ubuntu_700Bold',
        maxWidth: 260,
        textAlign: 'center',
        marginVertical: 10,
    },

    view: {
        marginTop: 73,
        alignItems: 'center',
    },


}

export default styles;
